  3 cells allot

  : store-arr 10 0 do i 1+ arr i + ! loop ;
  : change-arr 
      10 0 do
        i arr + dup 
        @ 2 *
        swap !
      loop ;
  : load-arr 10 0 do arr i + @ . 32 emit loop ; 

  store-arr 
  change-arr change-arr 
  load-arr
  halt
